import React, { useEffect } from 'react';
import { Container } from 'react-bootstrap';
import { Row, Col } from 'reactstrap';
import authService from '../../authentication/auth.service';
import NavBar from './Navbar';
import ServiceCard from './ServiceCard';
import c from './utils/c.gif';
import e from './utils/e.gif';
import h from './utils/h.gif';
import m from './utils/m.gif';
import p from './utils/p.gif';
import p1 from './utils/p1.gif';
import p2 from './utils/p2.gif';
import s from './utils/s.gif';
import w from './utils/w.gif';

const Home = () => {

    useEffect(() => {
        authService.logout();
    })

    return (
        <div>
            <div>
                <NavBar />
                <br /><br />
                <h1 className="myText">OUR SERVICES</h1>
                <br /><br />
            </div>
            <div className="text-center">
                <Row>
                    <Col>
                        <h1>Customer Services</h1>
                        <img src={p2} />
                        <Row>
                            <Col>
                                <img src={w} />
                            </Col>
                            <Col>
                                <img src={c} />
                            </Col>
                        </Row>
                        <Row>
                            <Col>
                                <img src={e} />
                            </Col>
                            <Col>
                                <img src={h} />
                            </Col>
                        </Row>
                        <Row>
                            <Col>
                                <img src={m} />
                            </Col>
                            <Col>
                                <img src={p} />
                            </Col>
                        </Row>
                        <img src={p1} />
                        <br />
                        <br />
                        <img src={s} />
                    </Col>
                    <Col>
                        <h1>Worker Services</h1>
                    </Col>

                </Row>
            </div>
        </div>

    );
}

export default Home;
